import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

import "../public/styles/style.css";
import logo from '../public/images/Logo.png';

export default class Navbar extends Component {

  render() {
    return (
        <nav className='navbar'>
        <div className="nav-item-1">
            <img src={logo} width="120" height="120"/>
        </div>
        <div className="nav-item-2">
          <p className="navbar-brand">Anthony Rich</p>
        </div>
        <div className="nav-item">
          <a className="nav-link" href="../">Inicio</a>
        </div>
        <div className="nav-item">
          <a className="nav-link" href="/projects/projects">Proyectos</a>
        </div>
        <div className="nav-item">
            <a className="nav-link" href="#">Intereses</a>
        </div>
          <div className="nav-item">
            <a className="nav-link" href="#">Habilidades</a>
          </div>
          <div className="nav-item">
            <a className="nav-link" href="#">Conocimiento</a>
          </div>

      </nav>
    );
  }
}
